import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import { Form, Input, Button, Checkbox, Typography } from 'antd';
import { authLogin } from '../../../../Api/ProductsApi';
import {
  WrapperLogin,
  WrapperTitle,
  MainContainer,
  Registrate,
  CustomInput,
  CustomInputPassword,
  CustomCard,
} from './styled';
import { LoginAction } from '../../../../Redux/Actions/LoginAction';
import Notification from '../../../global/Notification';
const { Title, Text } = Typography;

const layout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 16 },
};
const tailLayout = {
  wrapperCol: { offset: 8, span: 16 },
};

const Login = ({ setShowComponent }) => {
  const [loading, setloading] = useState(false);
  const [data, setdata] = useState('');
  const dispatch = useDispatch();

  const onFinish = async (values) => {
    setloading(true);
    console.log('Success:', values);
    try {
      const res = await authLogin(values);
      console.log(res, 'res');
      if (!res.data.error) {
        Notification({
          type: 'success',
          message: 'Bienvenidos',
        });
        setdata(res.data);
        //redirect({ route: '/envios-en-curso' });
        await dispatch(LoginAction(res.data));
        console.log(res, 'error');
        setloading(false);
      } else {
        //    {res.data === 'please enter all fields' ? <Notification  message='Por favor ingrese todos los campos'  type='error' />  : <Notification  message='El usuario ya existe'  type='error' /> Notification({
        //      type: 'error',
        //      message: 'El usuario ya existe'
        //  }) }
        Notification({
          type: 'error',
          message: 'El usuario ya existe',
        });
        setloading(false);
      }
      //  if (getData.data.error) {
      //    setOpenNotification(true);
      //    setnotificationMessage(getData.data.error);
      //  }
    } catch (error) {
      console.log(error);
    }
  };

  const onFinishFailed = (errorInfo) => {
    console.log('Failed:', errorInfo);
  };

  return (
    <MainContainer>
      <Registrate>
        <Text type='secondary' style={{ color: 'red', marginRight: '-10px', marginTop: '-20px' }}>
          No tienes cuenta?
        </Text>{' '}
        <Button type='link' style={{ marginTop: '-25px', color: 'red', marginRight: '-10px' }}>
          Registrate
        </Button>
      </Registrate>
      <WrapperTitle>
        <Title type='secondary'>Iniciar Sesion</Title>
      </WrapperTitle>

      <WrapperLogin>
        <Form
          {...layout}
          name='basic'
          initialValues={{ remember: true }}
          onFinish={onFinish}
          onFinishFailed={onFinishFailed}>
          <Form.Item
            label=''
            name='name'
            rules={[{ required: true, message: 'Please input your username!' }]}>
            <CustomInput placeholder='Usuario' />
          </Form.Item>

          <Form.Item
            label=''
            name='password'
            rules={[{ required: true, message: 'Please input your password!' }]}>
            <CustomInputPassword placeholder='Clave' />
          </Form.Item>

          {/*<Form.Item {...tailLayout} name='remember' valuePropName='checked'>
            <Checkbox>Remember me</Checkbox>
          </Form.Item>*/}

          <Form.Item {...tailLayout}>
            <Button type='primary' htmlType='submit' ghost style={{ color: '#111d2c' }}>
              Iniciar Sesi√≥n
            </Button>
          </Form.Item>
        </Form>
      </WrapperLogin>

      <WrapperLogin>
        <Button
          style={{ color: '#111d2c' }}
          type='link'
          onClick={() => setShowComponent({ Login: false, Recover: true, Signup: false })}>
          Olvidaste Contrasena?
        </Button>
      </WrapperLogin>
    </MainContainer>
  );
};

export default Login;
